      "No one ever said it would be easy... Going Against The Grain. And, no one understands more than we do, the challenges of delivering delicious gluten free products in a world of industrialized food. There was a time when food was hand-crafted at home from simple, farm-fresh ingredients and eaten with respect. Somewhere along the way, the people were taken out of food production, and then the real ingredients themselves. Food chemists invented flavor enhancers, dough conditioners, binders, preservatives, and modified basic food starches beyond recognition. Something as sacred as a cheese-topped pizza was transformed from comfort food into a chemistry experiment. Here at Against The Grain, we sincerely believe that you are what you eat. Our milk comes from a local family farm that bottles the milk less than 24 hours before we receive it. Our eggs are delivered directly from the hens to us by a local family egg farm - you can't find them any fresher. We use expeller-pressed non-GMO canola oil and low fat mozzarella cheese made from the milk of dairy cows that are routinely veterinarian inspected. Our cheese has no added growth hormones, no anti-caking agents, and is natamycin-free. We never use any binders, dough conditioners, flavor enhancers, stabilizers, or preservatives. In fact, you can pronounce and spell all of our ingredients! No preservatives, dough conditioners, gums, or flavor enhancers are ever used in any of our products. Try other Against The Grain gourmet products: Pepperoni pizza. Pumpermickle rolls. Three cheese pizza. Sesame bagels. Original baguettes. Sun-dried tomato basil bagels. Rosemary baguettes. 12-inch pizza shell. Original rolls. Dairy free cinnamon raisin bagels. Rosemary rolls. Dairy free Vermont country rolls. Who is Against The Grain? We're a family-owned commercial bakery located in one of the coolest towns in the United States - Brattleboro, Vermont. On the banks of the Connecticut river, we bake all-natural artisan breads, pizza shells, and pizzas in a 22,000 square foot dedicated gluten free facility. Our products contain no gluten, wheat, corn, soy, rice, sugar, yeast, peanuts, or tree nuts. We believe strongly in supporting our local economy as well as providing livable wages. We provide employment opportunities for people with disabilities. We sponsor Strolling of the Heifers www.strollingoftheheifers.com. We give all our bloopers to local food shelters. \"When the gods wish to punish us, they answer our prayers.\" Oscar Wilde. If you obey all the rules, you miss all the fun. Katharine Hepburn. We'd love to hear from you. 802-258-3838. info@againstthegraingourmet.com. againstthegraingourmet.com. 2012.",
